import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';

import Users from './users/pages/Users';

const App = () => {
  return (
    <Route>
      <Route path="/">
        <Users />
      </Route>

    </Route>
  );
};

export default App;
